import Quiz , {quizTemplate} from './Quiz'
import H1 , {h1Template} from './H1'
import P , {pTemplate} from './P'
import Markdown , {markdownTemplate} from './Markdown'

export default function Line(props){

	switch(props.data.type){
		case quizTemplate.type:
			return <Quiz {...props}/>
			break;

		case h1Template.type:
			return <H1 {...props}/>
			break;


		case pTemplate.type:
			return <P {...props}/>
			break;

		case markdownTemplate.type:
			return <Markdown {...props}/>
			break;

		default:
			return <div/>
	}
	return blocks[props.type] 
}

export const lineTypes = [h1Template.type,"h2",pTemplate.type,"blockquote",quizTemplate.type, markdownTemplate.type]

export const templates = {
	quiz: quizTemplate,
	h1: h1Template,
	p: pTemplate,
	md: markdownTemplate
}
